import React, { Component } from 'react'
import ForgotPasswordForm from '../components/ForgotPasswordForm'

class ForgotPassword extends Component{
  render() {
    return (
      <div className='content'>
        <ForgotPasswordForm />
      </div>
    )
  }
}

export default ForgotPassword;
